import React from "react";

function EmployeList({ list, showAlert, empID }) {
  console.log(list);
  console.log(empID);

  const empDept = list.map((emp, index) => <h3 key={index}>{emp.de}</h3>);

  return <div>{empDept}</div>;
}

export default EmployeList;
